PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE guests (
  val text primary key
  );
CREATE TABLE neatness (
  val text primary key
  );
CREATE TABLE sleep (
  val text primary key
  );
CREATE TABLE awake (
  val text primary key
  );
CREATE TABLE IF NOT EXISTS "users"
(
    id       integer not null
        constraint users_pk
            primary key autoincrement,
    name     TEXT,
    guests   TEXT,
    neatness text,
    sleep    TEXT    not null,
    awake    text
);
CREATE TABLE flag (
flag text
);
DELETE FROM sqlite_sequence;
